import React from "react";
import './index.css';

function FooterPage() {
    return (
        <div className="footer-container">
            <span className="f-logo">
                <img src={home} alt="sign-facebook" height="48" width="48" className="footer-logo" />
            </span>
            <span className="f-logo">
                <img src={search} alt="sign-facebook" height="48" width="48" className="footer-logo" />
            </span>
            <span className="f-logo">
                <img src={star} alt="sign-facebook" height="48" width="48" className="footer-logo" />
            </span>
            <span className="f-logo">
                <img src={cart} alt="sign-facebook" height="48" width="48" className="footer-logo" />
            </span>
            <span className="f-logo">
                <img src={profile} alt="sign-facebook" height="48" width="48" className="footer-logo" />
            </span>

        </div>

    );
}

export default FooterPage;
